import React, { useState } from 'react';
import axios from 'axios';

const CreatePassenger = () => {
  const [formData, setFormData] = useState({
    flight_id: '',
    passenger_name: '',
    age: '',
    gender: '',
    nationality: '',
    seat_type: '',
    seat_number: '',
    children: []
  });

  const [childData, setChildData] = useState({
    child_name: '',
    age: '',
    gender: '',
    nationality: ''
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleChildChange = (e) => {
    setChildData({ ...childData, [e.target.name]: e.target.value });
  };

  const addChild = () => {
    setFormData({
      ...formData,
      children: [...formData.children, childData]
    });
    setChildData({
      child_name: '',
      age: '',
      gender: '',
      nationality: ''
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    axios.post('http://127.0.0.1:8000/api/passengerinfo/save-passenger/', formData)
      .then(response => {
        console.log(response.data);
        // Handle success - perhaps redirect or show a message
      })
      .catch(error => {
        console.error(error);
        // Handle error - show an error message
      });
  };

  return (
    <form onSubmit={handleSubmit}>
      <h2>Create Passenger</h2>
      <label>Flight ID:</label>
      <input type="text" name="flight_id" value={formData.flight_id} onChange={handleChange} required />
      <label>Passenger Name:</label>
      <input type="text" name="passenger_name" value={formData.passenger_name} onChange={handleChange} required />
      <label>Age:</label>
      <input type="number" name="age" value={formData.age} onChange={handleChange} required />
      <label>Gender:</label>
      <input type="text" name="gender" value={formData.gender} onChange={handleChange} required />
      <label>Nationality:</label>
      <input type="text" name="nationality" value={formData.nationality} onChange={handleChange} required />
      <label>Seat Type:</label>
      <input type="text" name="seat_type" value={formData.seat_type} onChange={handleChange} required />
      <label>Seat Number:</label>
      <input type="text" name="seat_number" value={formData.seat_number} onChange={handleChange} required />
      
      <h3>Add Child</h3>
      <label>Child Name:</label>
      <input type="text" name="child_name" value={childData.child_name} onChange={handleChildChange} />
      <label>Age:</label>
      <input type="number" name="age" value={childData.age} onChange={handleChildChange} />
      <label>Gender:</label>
      <input type="text" name="gender" value={childData.gender} onChange={handleChildChange} />
      <label>Nationality:</label>
      <input type="text" name="nationality" value={childData.nationality} onChange={handleChildChange} />
      <button type="button" onClick={addChild}>Add Child</button>

      <button type="submit">Create Passenger</button>
    </form>
  );
};

export default CreatePassenger;
